webpackJsonp([0x7bdf01ab5fc8a00],{"./node_modules/json-loader/index.js!./.cache/json/sql-sql-insert-into-statement.json":function(n,s){n.exports={data:{markdownRemark:{html:'<h2>SQL Insert into Statement</h2>\n<p>To insert a record in a table you use the <code>INSERT INTO</code> statement. </p>\n<p>You can do it in two ways, if you want to insert values only in some columns, you have to list their names including all mandatory columns.  The syntax is:</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">INSERT</span> <span class="token keyword">INTO</span> table_name <span class="token punctuation">(</span>column1<span class="token punctuation">,</span> column2<span class="token punctuation">,</span> column3<span class="token punctuation">,</span> <span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">)</span>\n<span class="token keyword">VALUES</span> <span class="token punctuation">(</span>value1<span class="token punctuation">,</span> value2<span class="token punctuation">,</span> value3<span class="token punctuation">,</span> <span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>The other way is inserting values to all columns in the table, it is not necessary to specify the columns names. The syntax is:</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">INSERT</span> <span class="token keyword">INTO</span> table_name \n<span class="token keyword">VALUES</span> <span class="token punctuation">(</span>value1<span class="token punctuation">,</span> value2<span class="token punctuation">,</span> value3<span class="token punctuation">,</span> <span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Here’s an example inserting a record in the table Person in both ways:</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">INSERT</span> <span class="token keyword">INTO</span> Person\n<span class="token keyword">VALUES</span> <span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">,</span> ‘John Lennon’<span class="token punctuation">,</span> ‘<span class="token number">1940</span><span class="token operator">-</span><span class="token number">10</span><span class="token operator">-</span><span class="token number">09</span>’<span class="token punctuation">,</span> ‘M’<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>And</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">INSERT</span> <span class="token keyword">INTO</span> Person<span class="token punctuation">(</span>Id<span class="token punctuation">,</span> Name<span class="token punctuation">,</span> DateOfBirth<span class="token punctuation">,</span> Gender<span class="token punctuation">)</span>\n<span class="token keyword">VALUES</span> <span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">,</span> ‘John Lennon’<span class="token punctuation">,</span> ‘<span class="token number">1940</span><span class="token operator">-</span><span class="token number">10</span><span class="token operator">-</span><span class="token number">09</span>’<span class="token punctuation">,</span> ‘M’<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>',fields:{slug:"/sql/sql-insert-into-statement/"},frontmatter:{title:"SQL Insert into Statement"}}},pathContext:{slug:"/sql/sql-insert-into-statement/"}}}});
